  Western Pennsylvania Regional Data Center supports key community initiatives by
  making public information easier to find and use. The Data Center maintains Allegheny
  County and the City of Pittsburghu2019s open data portal, and provides a number
  of services to data publishers and users. The Data Center also hosts datasets from
  these and other public sector agencies, academic institutions, and non-profit organizations.
  The Data Center is managed by the University of Pittsburghu2019s Center for Social
  and Urban Research, and is a partnership of the University, Allegheny County and
